for (let i = 0; i < regionNames.length; i++) {
    $('#regionSelect').append($('<option>', {
        text: regionNames[i],
        value: i + 1,
    }));
}

$("#regionSelect").click(function () {
    $('#TIK').empty()
    $('#YIK').empty()
    let id = $("#regionSelect").val()
    let options = regions[id]
    for (let i = 0; i < options.length; i++) {
        $('#TIK').append($('<option>', {
            value: tec_list[options[i]]['id'],
            text: tec_list[options[i]]['title'],
        }));
    }
});

$("#TIK").click(function () {
    let TVal = $("#TIK").val()
    let items = tec_list[TVal]['items']
    $('#YIK').empty()
    for (let i = 0; i < items.length; i++) {
        $('#YIK').append($('<option>', {
            text: items[i][0] + ' ' + items[i][1],
            value: items[i][0] + ' ' + items[i][1],
        }));
    }
});
